    [],nt"num_tags": 0,nt"name": "nevada-isostatic-residual-gravity-over-basement",nt"isopen":
    false,nt"url": null,nt"notes": "This study of gravity data from Nevada
    is part of a statewide analysis of mineral resources. The main objective of the
    gravity study were: 1) to infer the structure and composition of the basement; 2)
    to determine the thickness of Cenozoic deposits. An iterative procedure based on
    the gravity data, a knowledge of the surface geology, and an estimate of the density
    of Cenozoic deposits was used to separate the isostatic residual gravity field into
    two component parts, a "basement" component and a "cover thickness" component.
    The former component contains information about the basement whereas the latter
    yields an estimate of the thickness of Cenozoic deposits. All computations were
    performed with a rectangular grid having intersections spaced at 2 km. The results
    are presented as contours on two maps at a scale of 1:1,000,000. Sheet 1 represents
    the basement gravity and sheet 2 represents the inferred thickness of Cenozoic cover.
    For complete details see Open File Report 90-404.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
